// TodoSidebar.js
import React from 'react';
import TodoItem from './TodoItem'; // Make sure to import TodoItem

const TodoSidebar = ({ selectedListObject, onSelectTodo }) => {
  console.log(selectedListObject);

  return (
    <div style={{ width: '250px', padding: '10px' }}>
      {selectedListObject?.todos?.map(todo => (
        <div key={todo.id} onClick={() => onSelectTodo(todo.id)}>
          <TodoItem todo={todo} /> 
        </div>
      ))}
    </div>
  );
};

export default TodoSidebar;
